import React from 'react';

import '../index.css'

import { Navigate } from 'react-router-dom';
import { GoogleLogin } from 'react-google-login';
import { useAuth } from '../auth/functions';

const googleClientId = '301139010020-rm1mnr8dlnd3656lt8j5f1gv6o001uv6.apps.googleusercontent.com'

class Login extends React.Component {

    constructor(props) {
        super(props);
        this.handleLogin = this.handleLogin.bind(this);
        this.handleLoginFailure = this.handleLoginFailure.bind(this);
    }

    async handleLogin(googleData) {

        const { login } = useAuth();
        login(googleData.tokenId)
        console.log('here baby')
    }

    async handleLoginFailure(err) {
        console.log('Failed to login');
        console.log(err);
    }

    render() {

        const { authed } = useAuth();

        if (auth) {
            return <Navigate to='/' />
        } else {
            return (
                <div sx={{
                    bgcolor: 'orange',
                }}>
                    <Container component="main" maxWidth="xs" className='expand_and_center'>
                        <CssBaseline />
                        <Box
                            sx={{
                                marginTop: 8,
                                display: 'flex',
                                flexDirection: 'column',
                                alignItems: 'center',
                            }}
                        >
                            <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
                                <AirportShuttleRounded />
                            </Avatar>
                            <Typography component="h1" variant="h4">
                                Cruise Coordinator
                            </Typography>
                            <Typography component="h5" variant="h6">
                                Placeholder text for description or catchphrase or something
                            </Typography>
                            <GoogleLogin
                                clientId={googleClientId}
                                buttonText='Sign In with Google'
                                onSuccess={this.handleLogin}
                                onFailure={this.handleLoginFailure}
                                cookiePolicy={'single_host_origin'}
                            />
                        </Box>
                    </Container>
                </div>
            )
        }
    }
}

export default Login;
